import React from "react";
import ReactDom from "react-dom";
import "./index.css";

const title = "Title";
const author = "Author";
const img = "https://m.media-amazon.com/images/I/61JSKZ6vHQS._AC_UY218_.jpg";

function BookList() {
  return (
    <section className="booklist">
      <Book />
    </section>
  );
}

const Book = () => {
  return (
    <article className="book">
      <img src={img} />
      <h1>{title}</h1>
      <h4>{author}</h4>
      <p></p>
    </article>
  );
};

ReactDom.render(<BookList />, document.getElementById("root"));
